    {
        "@type": "tissue specificity",
        "text": {
            "@evidence": "52",
            "#text": "Ubiquitous. Isoforms are expressed in a wide range of normal tissues but in a tissue-dependent manner. Isoform 2 is expressed in most normal tissues but is not detected in brain, lung, prostate, muscle, fetal brain, spinal cord and fetal liver. Isoform 3 is expressed in most normal tissues but is not detected in lung, spleen, testis, fetal brain, spinal cord and fetal liver. Isoform 7 is expressed in most normal tissues but is not detected in prostate, uterus, skeletal muscle and breast. Isoform 8 is detected only in colon, bone marrow, testis, fetal brain and intestine. Isoform 9 is expressed in most normal tissues but is not detected in brain, heart, lung, fetal liver, salivary gland, breast or intestine.",
        },
    },
    {
        "@type": "induction",
        "text": {
            "@evidence": "7 52",
            "#text": "Up-regulated in response to DNA damage. Isoform 2 is not induced in tumor cells in response to stress.",
        },
    },
    {
        "@type": "domain",
        "text": {
            "@evidence": "81",
            "#text": "The nuclear export signal acts as a transcriptional repression domain. The TADI and TADII motifs (residues 17 to 25 and 48 to 56) correspond both to 9aaTAD motifs which are transactivation domains present in a large number of yeast and animal transcription factors.",
        },
    },
    {
        "@type": "PTM",
        "text": {
            "@evidence": "10 44 116 137 150",
            "#text": "Acetylation of Lys-382 by CREBBP enhances transcriptional activity (PubMed:10656795, PubMed:15448695, PubMed:20228809, PubMed:23431171). Acetylation of Lys-382 by EP300 (PubMed:10656795, PubMed:15448695, PubMed:20228809, PubMed:23431171). Deacetylation of Lys-382 by SIRT1 impairs its ability to induce proapoptotic program and modulate cell senescence (PubMed:10656795, PubMed:15448695, PubMed:20228809, PubMed:23431171). Deacetylation by SIRT2 impairs its ability to induce transcription activation in a AKT-dependent manner (PubMed:10656795, PubMed:15448695, PubMed:20228809, PubMed:23431171). Acetylation at Lys-381 increases stability (PubMed:29474172). Deacetylation at Lys-381 by SIRT6 decreases its stability, thereby regulating cell senescence (PubMed:29474172).",
        },
    },
    {
        "@type": "PTM",
        "text": {
            "@evidence": "1 7 8 12 13 17 18 20 21 22 23 24 29 37 38 51 57 61 68 69 76 79 82 88 89 109 113 122 123 124 130 148 164",
            "#text": "Phosphorylation on Ser residues mediates transcriptional activation. Phosphorylated by HIPK1 (By similarity). Phosphorylation at Ser-9 by HIPK4 increases repression activity on BIRC5 promoter. Phosphorylated on Thr-18 by VRK1. Phosphorylated on Ser-20 by CHEK2 in response to DNA damage, which prevents ubiquitination by MDM2. Phosphorylated on Ser-20 by PLK3 in response to reactive oxygen species (ROS), promoting p53/TP53-mediated apoptosis. Phosphorylated on Thr-55 by TAF1, which promotes MDM2-mediated degradation. Phosphorylated on Ser-33 by CDK7 in a CAK complex in response to DNA damage. Phosphorylated on Ser-46 by HIPK2 upon UV irradiation. Phosphorylation on Ser-46 is required for acetylation by CREBBP. Phosphorylated on Ser-392 following UV but not gamma irradiation. Phosphorylated by NUAK1 at Ser-15 and Ser-392; was initially thought to be mediated by STK11/LKB1 but it was later shown that it is indirect and that STK11/LKB1-dependent phosphorylation is probably mediated by downstream NUAK1 (PubMed:21317932). It is unclear whether AMP directly mediates phosphorylation at Ser-15. Phosphorylated on Thr-18 by isoform 1 and isoform 2 of VRK2. Phosphorylation on Thr-18 by isoform 2 of VRK2 results in a reduction in ubiquitination by MDM2 and an increase in acetylation by EP300. Stabilized by CDK5-mediated phosphorylation in response to genotoxic and oxidative stresses at Ser-15, Ser-33 and Ser-46, leading to accumulation of p53/TP53, particularly in the nucleus, thus inducing the transactivation of p53/TP53 target genes. Phosphorylated by DYRK2 at Ser-46 in response to genotoxic stress. Phosphorylated at Ser-315 and Ser-392 by CDK2 in response to DNA-damage. Phosphorylation at Ser-15 is required for interaction with DDX3X and gamma-tubulin (PubMed:28842590).",
        },
    },
    {
        "@type": "PTM",
        "text": "Dephosphorylated by PP2A-PPP2R5C holoenzyme at Thr-55. SV40 small T antigen inhibits the dephosphorylation by the AC form of PP2A.",
    },
    {
        "@type": "PTM",
        "text": {
            "@evidence": "159",
            "#text": "May be O-glycosylated in the C-terminal basic region. Studied in EB-1 cell line.",
        },
    },
    {
        "@type": "PTM",
        "text": {
            "@evidence": "2 11 29 39 43 73 90 99 102 103 106 107 111 115 126 143 144",
            "#text": "Ubiquitinated by MDM2 and SYVN1, which leads to proteasomal degradation (PubMed:10722742, PubMed:12810724, PubMed:15340061, PubMed:17170702, PubMed:19880522). Ubiquitinated by RFWD3, which works in cooperation with MDM2 and may catalyze the formation of short polyubiquitin chains on p53/TP53 that are not targeted to the proteasome (PubMed:10722742, PubMed:12810724, PubMed:20173098). Ubiquitinated by MKRN1 at Lys-291 and Lys-292, which leads to proteasomal degradation (PubMed:19536131). Deubiquitinated by USP10, leading to its stabilization (PubMed:20096447). Ubiquitinated by TRIM24, RFFL, RNF34 and RNF125, which leads to proteasomal degradation (PubMed:19556538). Ubiquitination by TOPORS induces degradation (PubMed:19473992). Deubiquitination by USP7, leading to stabilization (PubMed:15053880). Isoform 4 is monoubiquitinated in an MDM2-independent manner (PubMed:15340061). Ubiquitinated by COP1, which leads to proteasomal degradation (PubMed:19837670). Ubiquitination and subsequent proteasomal degradation is negatively regulated by CCAR2 (PubMed:25732823). Polyubiquitinated by C10orf90/FATS, polyubiquitination is 'Lys-48'-linkage independent and non-proteolytic, leading to TP53 stabilization (By similarity). Polyubiquitinated by MUL1 at Lys-24 which leads to proteasomal degradation (PubMed:21597459).",
        },
    },
    {
        "@type": "PTM",
        "text": {
            "@evidence": "46 59 70 83 85 97 112 135",
            "#text": "Monomethylated at Lys-372 by SETD7, leading to stabilization and increased transcriptional activation (PubMed:15525938, PubMed:16415881). Monomethylated at Lys-370 by SMYD2, leading to decreased DNA-binding activity and subsequent transcriptional regulation activity (PubMed:17108971). Lys-372 monomethylation prevents interaction with SMYD2 and subsequent monomethylation at Lys-370 (PubMed:17108971). Dimethylated at Lys-373 by EHMT1 and EHMT2 (PubMed:20118233). Monomethylated at Lys-382 by KMT5A, promoting interaction with L3MBTL1 and leading to repress transcriptional activity (PubMed:17707234). Dimethylation at Lys-370 and Lys-382 diminishes p53 ubiquitination, through stabilizing association with the methyl reader PHF20 (PubMed:22864287). Demethylation of dimethylated Lys-370 by KDM1A prevents interaction with TP53BP1 and represses TP53-mediated transcriptional activation (PubMed:17805299). Monomethylated at Arg-333 and dimethylated at Arg-335 and Arg-337 by PRMT5; methylation is increased after DNA damage and might possibly affect TP53 target gene specificity (PubMed:19011621).",
        },
    },
    {
        "@type": "PTM",
        "text": {
            "@evidence": "16 130 174",
            "#text": "Sumoylated with SUMO1. Sumoylated at Lys-386 by UBC9.",
        },
    },
